import React from 'react';
import {Link} from 'react-router-dom';
import logo from "./doc.jpeg"

function docDetails(){
    return(
        <div className='docDetails'>
            <Link to='/'>
                <button className="btn btn-secondary doc_home">Home</button>
            </Link><br/><br/>

            <div className="row bg-dark det1">
                <img src={logo} className="logo2" alt="doc"/>
                lwddl
            </div>
        </div>
    )
}

export default docDetails;
